import React from 'react'
import {BrowserRouter,Routes,Route} from 'react-router-dom'

import Home from '../comps/Home'
export default function Router() {
  return (
    <BrowserRouter>

    <Routes>
        <Route path='home' element={<Home/>}/>

    </Routes>
    </BrowserRouter>
  )
}
